COLLATE_TEMPLATE = Template(COLLATE_TEMPLATE_STRING)

def collate_graphs(input_graphs: Iterable[Path],
                   out_path: Path,
                   group: str,
                   portable: bool,
                   **kwargs) -> Path:
    group_names = dict(ref="ref",
                       reference="ref",
                       reg="reg",
                       region="reg",
                       samp="sample",
                       sample="sample",
                       top="top",
                       out="top",
                       branch="branches",
                       branches="branches")
    group_name = group_names.get(group, None)
    groups = {}
    for file_path in input_graphs:
        try:
            path_segs = path.parse(file_path, path.GRAPH_SEGS)
        except Exception:
            path_segs = {}
        if group == "all":
            group_key = "all"
        else:
            group_key = f"[{', '.join(path_segs.get('branches', []))}]" if group_name == 'branches' else path_segs.get(group_name, "unknown")
            group_key = "[]" if group_key == "" else group_key
        groups.setdefault(group_key, []).append((path_segs, file_path))
    sorted_groups = [
        (group_key, sorted(files_list, key=lambda x: x[0].get('graph', '')))
        for group_key, files_list in sorted(groups.items())
    ]
    groups_data = []
    file_ids = set()
    for grp_idx, (group_key, files_list) in enumerate(sorted_groups):
        group_id = "".join(ch if ch.isalnum() else "-" for ch in group_key.lower()).strip("-") + f"-{grp_idx}" or f"group-{grp_idx}"
        files_data = []

        for idx, (metadata, file_path) in enumerate(files_list):
            name = file_path.stem
            file_id = "".join(ch if ch.isalnum() else "-" for ch in name.lower()).strip("-") + f"-{grp_idx}_{idx}" or f"file-{grp_idx}_{idx}"
            sample = metadata.get('sample', 'unknown')
            reference = metadata.get('ref', 'unknown')
            region = metadata.get('reg', 'unknown')
            branches = metadata.get('branches')
            if isinstance(branches, list):
                branches = f"[{', '.join(branches)}]" if branches else '[]'
            else:
                branches = branches or 'unknown'
            embed_content = ""
            # For portable mode OR if the file is an SVG, read the file.
            if portable or file_path.suffix.lower() == ".svg":
                try:
                    embed_content = file_path.read_text(encoding="utf-8")
                except Exception:
                    embed_content = "<p style='color: red;'>[Error loading content]</p>"
            if file_id in file_ids:
                raise ValueError("Multiple files have the same file_id.")
            file_ids.add(file_id)
            files_data.append({
                "name": name,
                "id": file_id,
                "sample": sample,
                "reference": reference,
                "region": region,
                "branches": branches,
                "src": os.path.relpath(file_path, out_path.parent),
                "embed": embed_content if (portable or file_path.suffix.lower() == ".svg") else None,
                "is_svg": file_path.suffix.lower() == ".svg"
            })
        groups_data.append({"group_name": group_key, "group_id": group_id, "files": files_data})
    contains_svg = any(file.get("is_svg") for group in groups_data for file in group["files"])
    logo_svg = draw_seismic_logo(report=True)
    out_path.write_text(
        COLLATE_TEMPLATE.render(
            groups=groups_data,
            sortable_js=SORTABLE_JS,
            logo_svg=logo_svg,
            contains_svg=contains_svg,
            SVG_PAN_ZOOM_JS=SVG_PAN_ZOOM_JS,
            portable=portable,
            JQUERY=JQUERY
        ),
        encoding="utf-8"
    )
    return out_path